import React from "react";
import Sucess from "../../../assets/sucess.svg";
import Button from "../../../components/Button";
import { Overlay } from "./styles";
import styled from "styled-components";

export const Modal = styled.div`
  width: 40vw;
  height: 60vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  background: #fff;
  padding: 1rem;
`;

export default function ModalSucess() {
  return (
    <Overlay>
      <Modal>
        <h1>Cadastro de Pessoa física concluído!</h1>
        <img src={Sucess} />
        <p>
          Enviamos um e-mail de confirmação para <strong>name@email.com</strong>
          . Verifique sua caixa de entrada para prosseguir.
        </p>
        <p> Caso não tenha recebido a confirmação, clique em Reenviar email.</p>
        <Button onClick={() => {}} text="cadastrar pessoa jurídica" />
        <h1>fazer login</h1>
      </Modal>
    </Overlay>
  );
}
